import React from 'react';
import './styles/App.css';


function App() {
  return (
    <div className="App">

    <div className="post">
      <div className='post__content'>
        <strong>Реестр оборудования БГТУ</strong>
        </div>


        <div className='auth'>
          <div>Регистрация</div>
          <br/>
          <div>Вход</div>
        </div>

    </div>
    <br/>
    <br/>
    <div>Добавить оборудования</div>
    </div>


  );
}

export default App;
